(1, '5 Simple Tips for a Healthier Lifestyle', 'Living a healthier lifestyle doesnâ€™t have to be complicated. Start small with these five tips: \n  1. Stay hydrated by drinking plenty of water daily. \n  2. Incorporate at least 30 minutes of physical activity into your routine. \n  3. Prioritize sleep to ensure your body recovers and recharges. \n  4. Choose whole foods over processed options for better nutrition. \n  5. Practice mindfulness or meditation to reduce stress and enhance mental clarity.', 'John Doe', NULL, '2024-11-17 17:35:55');
INSERT INTO `Blogs` (`id`, `title`, `content`, `author`, `image`, `date_created`) VALUES
(2, 'Understanding Preventive Care: Why It Matters', 'Preventive care is a cornerstone of staying healthy. Regular check-ups, vaccinations, and screenings can help detect and prevent illnesses before they become serious. Did you know that preventive care reduces the risk of chronic diseases like diabetes and hypertension? Schedule your annual physical today and take charge of your health.', 'Jane Smith', , '2024-11-17 17:35:55');
INSERT INTO `Blogs` (`id`, `title`, `content`, `author`, `image`, `date_created`) VALUES
(3, 'The Role of Nutrition in Overall Health', 'Your diet significantly impacts your health. Eating a balanced diet rich in fruits, vegetables, lean proteins, and whole grains supports your bodyâ€™s functions and boosts immunity. Avoid excessive sugar and salt intake, and aim for meals that fuel your energy levels throughout the day. Healthy eating is a lifestyle, not a temporary fix.', 'Kemoy Gallimore', , '2024-11-17 17:35:55');
INSERT INTO `Blogs` (`id`, `title`, `content`, `author`, `image`, `date_created`) VALUES
(4, 'FYI: Common Myths About Heart Health Debunked', 'Heart health is critical, yet misconceptions abound. Here are the facts:\n  1. Myth: Only older people get heart disease. Truth: It can affect people of all ages.\n  2. Myth: If you exercise regularly, you can eat anything. Truth: A balanced diet is essential, no matter your fitness routine.\n  3. Myth: Heart attacks are always dramatic. Truth: Symptoms can be subtle, such as fatigue or shortness of breath.\n  Knowing the truth about heart health can save lives. Stay informed!', 'Dr. John Doe', , '2024-11-17 17:35:55');

